import './style.css';
import React from 'react';
import dataIC from './dataIC.json';

class Graph extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            data : ''
        };
    }

    componentDidMount() {
        let that = this;

        dataIC.map(function(data){
            //return <li>{movie.id} - {movie.title}</li>;
            console.log( "data : " + JSON.stringify(data));
          });

        const height="210";
        const width="500";

        const svg = d3.select('#graph').append("svg")
        .attr("id", "svg")
        .attr("width", width)
        .attr("height", height);

        svg.append("line")
            .attr("id: line")
            .attr(x1="0")
            //endAngle(d => d.x1)
            .attr(y1=0)
            .attr(x2="200")
            .attr(y2="200")


    /* Logo
        <svg width="100%" height="100%" viewBox="0 0 100 100"
        xmlns="http://www.w3.org/2000/svg">
        <image href="/files/2917/fxlogo.png" x="0" y="0" height="100" width="100"/>
        </svg>
    */
      
    }

    renderLineX(){
        return <svg height="210" width="500">
                <line id="line" x1="0" y1="0" x2="200" y2="200" />
            </svg>
    }

    render() {
        return <div></div>
        
    }
}

export default Graph;
